package main

import "fmt"

func numberOfSubstringsBruteForce(s string) int {
	n := len(s)
	countOnes := make([]int, n)
	curr := 0
	for i := range s {
		if s[i] == '1' {
			curr++
		}
		countOnes[i] = curr
	}
	ans := 0
	for i := range n {
		for j := i; j < n; j++ {
			currOnes := countOnes[j]
			if i-1 >= 0 {
				currOnes -= countOnes[i-1]
			}
			countZeros := j - i + 1 - currOnes
			if currOnes >= countZeros*countZeros {
				ans++
			}

		}
	}
	return ans
}

func main() {
	s := ""
	fmt.Println(numberOfSubstringsBruteForce(s))
}
